  \"2014-11-13T17:06:18.792223\",\n\t\"name\": \"creative-class-county-codes\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The creative class thesisu2014that towns
  need to attract engineers, architects, artists, and people in other creative occupations
  to compete in today's economyu2014may be particularly relevant to rural communities,
  which tend to lose much of their talent when young adults leave. The ERS creative
  class codes indicate a county's share of population employed in occupations that
  require \"thinking creatively.\" Variables used to construct the ERS creative class
  measure include number and percent employed in creative class occupations and a
  metro/nonmetro indicator for all counties, 1990, 2000, and 2007-11. A break-out
  of employment in the arts is included.\",\n\t\"license_title\": \"Creative Commons
